import logo from './logo.svg';
import Profile from "./compnents/Profile/Profile.js";
import Scholarships from "./components/Scholarships/Scholarships.js";
import "./profile.css";
import "./scholarships.css";
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/">
            {Profile}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
